import React from 'react';
import './App.css';
import {Rating} from "./Components/Rating";
import {Accordion} from "./Components/Accordion";
import {OnOff} from "./Components/Onoff/OnOff";

function App() {
  return (
    <div >
        <AppTitle title={'This is App component'}/>
        <Rating value={0}/>
        <Accordion title={'Menu'} collapsed={true}/>
        <Accordion title={'Hello subscriber'} collapsed={false}/>
        <Rating value={0}/>
        <Rating value={1}/>
        <Rating value={2}/>
        <Rating value={3}/>
        <Rating value={4}/>
        <Rating value={5}/>
        <OnOff />
    </div>
  );
}

type AppTitleType = {
    title:string
}

function AppTitle (props:AppTitleType){
  return (
      <>
          {props.title}
      </>
  )
}




export default App;
